import logo from './logo.svg';
import Header from './Header.js';
import Infos from './Infos.js';
import Projets from './Projets.js';
import { Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.scss';
import './App.css';

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Button></Button>
      <Infos></Infos>
      <Projets></Projets>
    </div>
  );
}

export default App;
